INSERT INTO `ss_announce` VALUES ('17', '人气争夺赛启动~！谁是人气王，快来展现你的魅力', '活动玩法：<br />\r\n1、每天在手机BoBo的任意直播间在线5分钟（要在直播间内哦），可获赠1个专属礼物-皇冠，在礼物栏的热门礼物栏（电脑端在包裹礼物栏）查看，可赠送给心仪的主播，帮助ta登上男女神榜；<br />\r\n2、用户每天在手机BoBo上充值任意金额，可再获得皇冠2个；<br />\r\n3、截至到活动结束，获得礼物最多的前三名主播可获得BoBo提供推荐位大礼包；<br />\r\n4、获得奖励的主播将有官方人员与之联系，所获得的推荐奖励须在7月份内使用，逾期视为放弃；<br />\r\n5、本活动仅限BoBo手机客户端参与，网易BoBo对本次活动拥有最终解释权。<br />', '1', '1436879257', '1436879257.jpg', '正在进行');
INSERT INTO `ss_announce` VALUES ('18', '与主播零距离，主播带你去履行！', '<p>\r\n	starwork（星工场）家族主播人气大比拼\r\n8月16日、8月17日为期两天，在福州苏宁广场全景透明玻璃室举办starwork（星工场）家族主播人气大比拼！\r\n</p>\r\n<p>\r\n	这是首次BOBO主播与粉丝真正“零距离”的活动，并采用线上线下交叉互动的方式，参与互动有机会赢取主播陪你“两天一夜游福州”以及“畅游泰国”的旅行大奖！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	主播陪你两天一夜游福州：\r\n</p>\r\n<p>\r\n	1、starwork星工场家族在福州苏宁广场中庭搭建全景透明玻璃直播室，作为主播人气大比拼的直播间。&nbsp;\r\n</p>\r\n<p>\r\n	2、starwork星工场旗下8位主播将从12:00—20:00每人一小时进行直播互动。&nbsp;\r\n</p>\r\n<p>\r\n	3、从2014年8月16日00:00—8月17日23:59，主播将以粉丝数和礼物数进行人气挑战。人气最高的三位主播将获得starwork星工场的超级主播称号。&nbsp;\r\n</p>\r\n<p>\r\n	4、礼物贡献最多的三位粉丝（可以来自同一主播）将成为幸运粉丝团团员。另外，粉丝最多的女主播，可以从自己的粉丝中挑选一位加入幸运粉丝团。&nbsp;\r\n</p>\r\n<p>\r\n	5、幸运粉丝团4位团员将由starwork星工场家族统一安排机票、住宿、餐饮，来到福州参加和主播的“两天一夜游福州”之旅。&nbsp;\r\n</p>\r\n<p>\r\n	6、“两天一夜游福州”将由starwork星工场8位主播当导游，和4位粉丝共同欣赏福州有趣的山水、人文，领略古城的美丽，另外，starwork星工场将特别安排粉丝参观星工场直播室，并与主播们共进晚餐，互动。starwork星工场的家族长“擎天柱”更是会第一次露出真面目和粉丝互动。&nbsp;\r\n</p>\r\n<p>\r\n	7、4位粉丝的交通食宿费用都将由星工场承担。（相关手续及时间由starwork星工场负责协调）。&nbsp;\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	主播陪你畅游泰国：&nbsp;\r\n</p>\r\n<p>\r\n	1、伴随线上直播，8月16、17日每天17:00和20:00，8位主播将会在福州苏宁广场做表演和现场互动游戏。&nbsp;\r\n</p>\r\n<p>\r\n	2、福州的粉丝可以来到现场和主播们近距离接触并拍照上传微信微博支持他们。每位来到现场支持主播的粉丝，都可以现场获得主播送给大家的百事可乐。&nbsp;\r\n</p>\r\n<p>\r\n	3、活动结束后一周，将在来到现场的粉丝中，由人气最高的三位主播，抽取20位现场粉丝，安排同游泰国的行程。\r\n</p>', '1', '1436879339', '1436879339.jpg', '未开始');
INSERT INTO `ss_announce` VALUES ('22', '富豪等级介绍', '<img src=\"/Public/editor/attached/image/20150828/20150828102456_80438.png\" width=\"710\" height=\"764\" alt=\"\" />', '3', '1440728708', '1440728708.png', '未开始');
INSERT INTO `ss_announce` VALUES ('20', '主播管理规范', '<p style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:2em;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">一、概述：</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	为了加强对爱悠悠直播网络社区业务管理，给爱悠悠用户提供一个健康和谐的才艺展示与欣赏平台，特制定本管理制度。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">二、视频直播间违规定义</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	爱悠悠直播主播必须遵守以下规定，否则将受到处罚。处罚后，主播未改正违规行为将视为再次违规。\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">严重违规行为（A类违规）</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	严重违规行为是指涉政、涉黄、恶意违规等严重扰乱爱悠悠直播视频直播平台秩序的行为。在视频直播中违反以下规定，构成严重违规，包括但不限于：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	1、严禁发表反党反政府的言论，或做出侮辱诋毁党和国家的行为，如：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（1）违反宪法确定的基本原则的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（2）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（3）损害国家荣誉和利益的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（4）煽动民族仇恨、民族歧视、破坏民族团结的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（5）散布谣言，扰乱社会秩序，破坏社会稳定的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（6）散布暴力、恐怖或者教唆犯罪的；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（7）煽动非法集会、结社、游行、示威、聚众扰乱社会秩序的。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	2、严禁涉黄行为，如：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（1）严禁与他人进行互相性挑逗形式的表演或行为，如相互抚摸敏感部位、进行能让人产生性幻想的动作、在床上以任何抚摸形式进行表演等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（2）严禁通过各种方式裸漏具有性特征的身体敏感部位，如展示女性胸部、男女性臀部、男女大腿内侧及生殖器官、穿透视装等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（3）严禁直播带有色情、性暗示的游戏、录像、图片、绘画、设计类教学。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	3、严禁恶意违规，带有危害性等行为，如：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（1）严禁展示枪支管制刀具、进行高危表演。如晃动管制刀具、枪支、高仿真枪支、表演具有高度危险性的节目等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（2）严禁表演危害他人人身安全的节目，如：殴打他人、以刀具威胁他人等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（3）严禁传播毒品。如展示毒品样品、表演及传播毒品吸食或注射方式、讲解毒品制作过程等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（4）严禁宣传传销机构、哄骗用户加入传销组织、或本人组织传销；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（5）严禁表演危害自身安全的节目，如自杀、自残。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>以上A类违规内容违规者，主播出现严重违规行为，则扣除当月全部薪资，直播停止，同时冻结账号9999小时。</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">一般违规行为（B类违规）</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	一般违规行为是指除严重违规行为外，影响程度较轻的扰乱爱悠悠直播网络社区平台秩序的违规行为。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	在视频直播中违反以下规定，构成一般违规，包括但不限于：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	1、内容规定：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（1）严禁组织以骚扰、戏弄为目的的网络电话；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（2）严禁演唱、播放带有色情、性暗示的音乐；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（3）严禁酒后直播表现耍酒疯、酣睡等醉态；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（4）严禁表演各种舞蹈；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（5）严禁进行具有性挑逗性质的表演或行为；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	2、动作规定：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp;&nbsp; 严禁表演时出现挑动人们性欲、导致普通人腐化、堕落，而又没有任何艺术价值的内容；包括但不限于以下内容：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（1）严禁模仿各种低俗、色情动作或带有诱惑性、挑逗性表演的行为；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（2）严禁将镜头刻意聚焦于性敏感部位，或进行带有性暗示的抚摸、拉扯动作，或使用道具引起观众对性敏感部位的注意；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（3）严禁使用性用品作为表演道具；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（4）严禁表演时使用道具模仿低俗、色情、性暗示的动作；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	3、裸露规定：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（1）严禁男性赤裸上身，女性露出乳房；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（2）严禁刻意露出胸罩、底裤；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（3）严禁穿着透明、情趣内衣、内衣外穿；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:26.25pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-26.25pt;background-color:#FFFFFF;\">\r\n	（4）严禁穿着过于暴露的衣服进行表演（包括但不限于：低胸、内衣、三点式露脐泳装、单穿抹胸、肉色紧身衣、三角牛仔裤、短于大腿1/3长度的下装）；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	4、言论规定：\r\n</p>\r\n<p align=\"left\" class=\