\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规1次）警告一次，关闭直播15分钟；</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规2次）锁定主播帐号24小时，罚款600元；</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规3次）锁定主播帐号9999小时，扣除当月所有薪资；</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>&nbsp;</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">轻微违规行为（C类违规）</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	轻微违规行为是指除严重违规行为和一般违规行为外，影响程度轻微的扰乱爱悠悠直播视频直播平台秩序的违规行为。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	在视频直播中违反以下规定，将构成轻微违规，包括但不限于：\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（1）严禁穿着带有中华人民共和国（包含港澳台）国家机关人员、军队的工作制服进行直播。包括警服、军服、工商制服、检察院制服、法院制服、城管制服、路政制服等；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（2）严禁持续爆粗口、谩骂；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（3）严禁进行其他类型违反爱悠悠直播社区相关秩序规范的表演；\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	（4）严禁在直播镜头前公然抽烟，喝酒。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>&nbsp;</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>以上C类违规内容违规者，按照违规次数给予处罚累计次数1次、2次、3次、4次处罚时长与金额：</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规1次）直播间弹窗警告一次；&nbsp;</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规2次）锁定主播帐号24小时，处罚金额100元；</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规3次）锁定主播帐号72小时，处罚金额500元；</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u>（违规4次）锁定主播帐号168小时，扣除当月所有薪资。</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><u><br />\r\n</u></span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">三、备注</span> \r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp; &nbsp;本管理制度由爱悠悠直播官方制定，最终解释权归爱悠悠直播所有，爱悠悠直播有权对本制度进行修改并公示。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:21pt;background-color:#FFFFFF;\">\r\n	本制度自发布之日起生效。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p align=\"right\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-align:right;background-color:#FFFFFF;\">\r\n	&nbsp; &nbsp;FMSCMS直播官方运营部\r\n</p>\r\n<p align=\"right\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-align:right;background-color:#FFFFFF;\">\r\n	2015年8月28日\r\n</p>', '3', '1440727744', '1440727744.png', '未开始');
INSERT INTO `ss_announce` VALUES ('21', '用户管理规范', '<span style=\"white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">一、概述：</span><span style=\"white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\"></span><span style=\"white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\"></span><span style=\"color:#CCCCCC;font-family:宋体, Arial, Helvetica, sans-serif;white-space:normal;background-color:#FBFBFB;\"></span> \r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	根据上级主管部门指示，为配合净网2015专项行动，营造健康绿色的娱乐环境，特别制定此条例。对恶意用户或外站工作人员假冒用户不同程度的违规行为进行处理。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	二、处罚措施的分类和违规行为说明\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	根据处罚措施的轻重程度不同，分为：警告；冻结账号3天；冻结账号30天;永久冻结账号。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	严重违规行为（A类违规）\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	严重违规行为是指涉政、涉黄、恶意违规等严重扰乱爱悠悠直播视频直播平台秩序的行为。在视频直播中违反以下规定，构成严重违规，包括但不限于；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	1、严禁用户发表反党反政府的言论，或做出侮辱诋毁党和国家的行为；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	2、严禁用户通过爱悠悠直播平台宣传、实施、协助他人网络黑市交易，例如：走私、洗钱毒品、办证、剧毒化学品等非法犯罪行为；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	3、严禁用户通过爱悠悠直播平台协助、宣传非法违禁广告，包括但不限于以下几类：宣传裸聊直播间、宣传一夜情、传播色情影音、传播色情播放链接、传播色情网站、传播色情服务QQ等；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	4、严禁用户通过爱悠悠直播平台实施诈骗，骗取他人财物或账户、柠檬、礼物等虚拟物品。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	以上A类违规内容违规者，给予用户永久冻结账号。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:7.1pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	一般违规行为（B类违规）\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	一般违规行为是指除严重违规行为外，影响程度较重地扰乱爱悠悠直播网络社区平台秩序的违规行为。违反以下规定，构成一般违规，包括但不限于；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	1、外站人员严重骚扰主播，造谣诽谤爱悠悠直播，并怂恿主播和其他用户的；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	2、利用第三方软件在直播间不间断刷屏辱骂,影响主播直播和用户聊天交流；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	3、在直播间无节制地注册小号捣乱、辱骂主播或用户，影响直播间的正常秩序；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;text-indent:0cm;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	以上B类违规内容违规者，根据违规的情况给予冻结账号3天或30天。用户若在违规处置期满后再次违规，将视情节轻重予以原处置期加倍处置或永久冻结账号\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	轻微违规行为（C类违规）\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:24pt;background-color:white;\">\r\n	轻微违规行为是指除严重违规行为和一般违规行为外，影响程度较轻地扰乱爱悠悠直播视频直播平台秩序的违规行为。\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:24pt;background-color:white;\">\r\n	在视频直播中违反以下规定，将构成轻微违规，包括但不限于；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:#FFFFFF;\">\r\n	1、恶意在多个直播间持续谩骂；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	2、在直播间谈论色情、低俗等不良言论信息；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;text-indent:0cm;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	以上C类违规内容违规者，<span style=\"font-weight:700;\">警告后无效</span>的直接给予冻结账号3天，用户若在违规处置期满后再次违规，将视情节轻重予以原处置期加倍处置或永久冻结账号\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	三、备注\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-top:0.5em;margin-bottom:0.5em;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;background-color:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	1、违规行为的轻重程度依据违规时间，违规对象，违规意图，违规影响范围等因素进行客观分析，综合评定，若违规用户改正态度良好则可减轻或免于处罚；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	2、用户如恶意开小号扰乱平台秩序，如查证属实，则连同其大号一并处罚；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	3、主播若违规将按照主播管理条例进行处罚；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	4、望广大用户遵守绿色娱乐的原则，共同维护爱悠悠直播平台健康快乐的美好环境；\r\n</p>\r\n<p align=\"left\" class=\"MsoListParagraph\" style=\"margin-top:0.5em;margin-bottom:0.5em;margin-left:21pt;padding:0px;white-space:normal;color:#666666;font-family:\'Microsoft YaHei UI\', \'Microsoft YaHei\', \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif;font-size:14px;line-height:25px;text-indent:-21pt;background-color:white;\">\r\n	5、此条例最终解释权归爱悠悠直播平台，如有疑问或建议可联系爱悠悠直播官方客服。\r\n</p>', '3', '1440728244', '1440728244.png', '未开始');
INSERT INTO `ss_announce` VALUES ('23', '商城—靓号', '<p class=\"tit\" style=\"margin-top:0px;margin-bottom:0px;padding:7px 10px 0px;font-family:微软雅黑, \'Microsoft YaHei\';font-size:16px;border:0px;color:#545454;font-weight:700;white-space:normal;background-color:#FFFFFF;\">\r\n	什么是靓号？\r\n</p>\r\n<p style=\"margin:0px;padding:10px;color:#666666;line-height:22px;font-family:微软雅黑, \'Arial Black\', 宋体;white-space:normal;background-color:#FFFFFF;\">\r\n	靓号，是区别与用户注册获得的UID序列号码。可以根据个人喜好定制具有特殊意义的专属号码。例如：生日号码，纪念日号码，情侣号码等。\r\n</p>\r\n<p style=\"margin:0px;padding:10px;color:#666666;line-height:22px;font-family:微软雅黑, \'Arial Black\', 宋体;white-space:normal;background-color:#FFFFFF;\">\r\n	<p class=\"tit\" style=\"margin-top:0px;margin-bottom:0px;padding:7px 10px 0px;font-family:微软雅黑, \'Microsoft YaHei\';font-size:16px;border:0px;color:#545454;font-weight:700;white-space:normal;background-color:#FFFFFF;\">\r\n		靓号特权\r\n	</p>\r\n	<div class=\"con\" style=\"margin:0px;padding:10px;color:#666666;line-height:22px;font-family:微软雅黑, \'Arial Black\', 宋体;white-space:normal;background-color:#FFFFFF;\">\r\n		<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n			专属显示：靓号专属标志，特殊号码及独特颜色\r\n		</p>\r\n		<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n			<br />\r\n		</p>\r\n		<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n			排序更靠前：落座排序中靓号用户更靠前\r\n		</p>\r\n	</div>\r\n</p>', '3', '1440728944', '1440728944.jpg', '未开始');
